import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';
import Login from './Login';
import Stats from './Statistiques';

function App() {
  return (
    <BrowserRouter>
      <Route exact path='/' component={Login} />
      {/* <Route path='/stats' component={Stats} /> */}
    </BrowserRouter>
  );
}

export default App;
